import React from "react";
import  Container from "@mui/material/Container";
import SendIcon from '@mui/icons-material/Send';
import {Input}  from '@mui/icons-material'
import TextField from '@mui/material/TextField';

import SearchResult from "../components/Modules/SearchResults";
import { Box } from "@mui/system";
import { useNavigate } from "react-router";
function MainSearch(props){
   let navigation=useNavigate()
    return (
        <section>    
            <article>   
                <h1> Animal Crossing Fishing Index</h1>

                            <TextField id="outlined-search" label="Search field" placeholder='Search for fish here' required={true} onChange={(event)=>{props.object.handleSearchChange(event.target.value)}}/>

                <button onClick={()=>{navigation('/AllFish')}}>See All</button>
                 <div width='auto' height='500'>
                         <SearchResult  result={props.object.state.searchResult}></SearchResult>
                 </div>
            </article>
        </section>
    );

}
export default MainSearch;
